import React, { useEffect, useState } from 'react';
import axiosWithAuth from '../utils/axiosWithAuth';

export default function FriendsList() {
	const [friends, setFriends] = useState([]);

	useEffect(() => {
		axiosWithAuth()
			.get('friends')
			.then((res) => {
				console.log(res);
			});
	}, []);

	return <div></div>;
}
